(()=>{var n=document.createElement("script");n.textContent="\n  const originalFetch = window.fetch;\n  window.fetch = async (...args) => {\n    const response = await originalFetch(...args);\n    const url = response.url;\n    if (url.includes('myqcloud.com') && \n        url.includes('.mp4') && \n        url.includes('recording')) {\n      window.postMessage({\n        type: 'VIDEO_URL_DETECTED',\n        url: url\n      }, '*');\n    }\n    return response;\n  };\n",document.documentElement.appendChild(n),window.addEventListener("message",(function(n){"VIDEO_URL_DETECTED"===n.data.type&&chrome.runtime.sendMessage({action:"foundVideoUrl",url:n.data.url})}))})();